import { CommonModule } from "@angular/common";

@NgModule({
   declarations:[CourseDetailsComponent ,AllCoursesComponent ,AddCourseComponent],
   imports:[CommonModule],
   exports:[AllCoursesComponent,AddCourseComponent]
